import axios from 'axios';
import {
  REGISTER_USER,
} from './types';



// Register User
export const register = async (formData) => {
  

  try {
    const res = await axios.post('http://localhost:5000/register', formData);
    console.log(res.data);
   
  } catch (err) {
    console.log(err)
  }
};
